ISLAMABAD, Feb 9 (APP): Independent candidate Muhammad Arif has won the Khyber Pakhtunkhwa Assembly election from PK-66, Charsadda-V by securing 33,155 votes.
According to unofficial result issued by the Returning Officer/ECP, his runner up was JUI-P candidate Haji Zafar Ali Khan who bagged 17,598 votes.
